import { Header } from './Header';
import { TaskCreation } from './TaskCreation';
import { TaskList } from './TaskList';
import { TaskItem } from './TaskItem';
import './App.css';

function App() {
  return (
<reactFragment>
      <Header completed={10} total ={15}/>
      <TaskCreation />
       <TaskList>
          <TaskItem />
          <TaskItem />
           <TaskItem />
         </TaskList>
      </reactFragment>
  );
}

export default App;
